function getLevel(playerXP) {
	for(var i = 1; i <= 10000; i++)	{
		var power = 3 + (i / 100000);
		var xp = Math.pow(i, power);
		if(playerXP < xp)
			return i - 1;
	}
}

function getGlobalLevel(player) {
	var globalLevel = 0;
		globalLevel += getLevel(window[player+'miningXp']);
		globalLevel += getLevel(window[player+'craftingXp']);
		globalLevel += getLevel(window[player+'woodcuttingXp']);
		globalLevel += getLevel(window[player+'farmingXp']);
		globalLevel += getLevel(window[player+'brewingXp']);
		globalLevel += getLevel(window[player+'exploringXp']);
		globalLevel += getLevel(window[player+'cookingXp']);
	return globalLevel;
}

function getGlobalXP(player) {
	var globalXP = 0;
		globalXP += parseInt(window[player+'miningXp']);
		globalXP += parseInt(window[player+'craftingXp']);
		globalXP += parseInt(window[player+'woodcuttingXp']);
		globalXP += parseInt(window[player+'farmingXp']);
		globalXP += parseInt(window[player+'brewingXp']);
		globalXP += parseInt(window[player+'exploringXp']);
		globalXP += parseInt(window[player+'cookingXp']);
	return globalXP;
}

function topFunction() {
  document.body.scrollTop = 0; // For Safari
  document.documentElement.scrollTop = 0; // For Chrome, Firefox, IE and Opera
}

const formatarTempo = segundos => {
  const data = new Date(segundos * 1000);
  const dias = Math.floor(segundos / (60 * 60 * 24));
  const horas = data.toISOString().substr(11, 8);

  return `${dias} days, ${horas}`;
};
